import { findAllByRole } from "@testing-library/react";
import React from "react"

function SurfSpot(){
    const [surfSpot, setSurfSpot] = useState([
        {location: newYork, weather: cloudy, conditions: fair },
        {location: Maui, weather: sunny, conditions: good },
        {location: Maui, weather: sunny, conditions: great }
    ])
    return(
        <div className="surfSpot"> </div>
    )
}

export default SurfSpot;
